### Non \((1,1,4,4)\)-Packing Colorable \(1\)-Saturated Graph

A \(1\)-saturated graph is one where adding any edge increases the chromatic number by 1. A non \((1,1,4,4)\)-packing colorable graph means that it does not contain four vertices such that each pair of vertices in the set has exactly two colors in a certain packing coloring scheme.

Here's a simple example of a \(1\)-saturated graph:

```latex
\documentclass{standalone}
\usepackage{tikz}

\begin{document}
\begin{tikzpicture}[scale=0.8]
    % Nodes
    \node (A) at (0,0) [circle, fill=blue] {};
    \node (B) at (2,0) [circle, fill=red] {};
    \node (C) at (1,-1.5) [circle, fill=green] {};
    \node (D) at (-1,-1.5) [circle, fill=yellow] {};

    % Edges
    \draw (A) -- (B);
    \draw (B) -- (C);
    \draw (C) -- (D);
    \draw (D) -- (A);

    % Adding an edge will increase the chromatic number
\end{tikzpicture}
\end{document}
```

